import "./App.css";
import Galaxy from "./galaxy";

function App() {
  return (
    <div className="main">
      <main>
        <div className="button"></div>
        <h2 className="description">
          Hi! This is Jayson. I am student, software & interface developer,
          artist, barista, and brain-science geek. Specifically, I find interest
          in exploring the intersection between machines, software, and human
          behaviour. Grew up in Toronto, studying Cognitive Science at UCLA.
          Email / Linkedin
        </h2>
      </main>
      <div className="wrap-galaxy">
        <Galaxy></Galaxy>
      </div>
    </div>
  );
}

export default App;
